(6, 'Hulk', 'New York City', 1, 'After result of exposure to gamma radiation he becomes a large, superhumanly strong, green creature of pure rage whenever he becomes angry. The Hulk has little intelligence and self-control and can cause great destruction, although he also is inclined to fight evil and protect the innocent', 1, NULL),
(7, 'Capitan America', 'Washington DC', 1, 'Captain America emerged during WWII when Steve Rogers joined the the U.S. Army and was administered with a Super-Soldier serum. He has the red, white, and blue costume of Captain America and a shield, an ultra-strong concave disk.', 1, NULL),
(8, 'Bruce Wills', 'New York City', 0, 'Actor and musician Bruce Willis is well known for playing wisecracking or hard-edged characters, often in spectacular action films. Frequently plays a man who suffered a tragedy, had lost something or had a crisis of confidence or conscience.', 1, NULL),
(9, 'Robocop', 'Detroit', 0, 'RoboCop is a fictional robotically enhanced Detroit police officer designated as OCP Crime Prevention Unit 001. Police officer named Alex J. Murphy is transformed into the cyborg entity RoboCop by the megacorporation.', 1, NULL),
(10, 'James Bond', 'Chelsea', 0, 'British Secret Service agent. Agent 007 is a nickname given to surgeons who tend to kill their patients, originating from James Bond\'s code number, which means \"License to kill.\" Bond\'s most famous car is the silver grey Aston Martin DB5', 1, NULL),
(11, 'Marc Sucenberg', 'Palo Alto', 0, 'Mark Elliot Zuckerberg is an American technology entrepreneur and philanthropist. He is known for co-founding and leading Facebook as its chairman and chief executive officer. Zuckerberg began using computers and writing software in middle school', 1, NULL);

